import './App.scss'
import Home from './Component/home/Home'
import About from './Component/about/About'
import Contact from './Component/contact/Contact'
import Project from './Component/project/Project'

function App() {
  return (
    <div className="App">
      <Home />
      <About />
      <Project />
      <Contact />
    </div>
  );
}

export default App;
